        "en": {
          "title": "Davis vs Garcia HIGHLIGHTS: January 7, 2023 | PBC on Showtime PPV",
          "description": "Boxing superstar and five-time world champion Gervonta Tank Davis sent a sold out crowd in the nations capital home happy with another memorable victory as he displayed his skills and then stopped featherweight champion Hector Luis Garcia in the ninth round Saturday night headlining live on SHOWTIME PPV from Capital One Arena in Washington, D.C. in an event presented by Premier Boxing Champions.\n \nThe Baltimore-native Davis delighted the 19,731 fans in attendance as he methodically broke down the previously unbeaten Garcia, before hurting him badly with his vaunted left hand late in the eighth round. Visibly shaken on his way back to the corner, Garcia stayed on his stool as the bell for round nine rang. Moments later, his trainer Bob Santos advised referee Albert Earl Brown to stop the fight, with the official stoppage coming 13 seconds into round nine.\n \nI was a little surprised he didnt come out, said Davis. But I knew he was hurt bad but hes a fighter and he didnt want to show it. I knew he was hurt though.\n \nWhen I got the shot to my head in the final round, thats when I couldnt see from my eye, said Garcia, who owns the WBA Super Featherweight World Title. I didnt know where I was when he hit me with that shot. My vision is back but my head still hurts. I couldnt see from my right eye. It was going well up until that point. I was picking my shots.\n \nThe two champions jockeyed for position over the first three rounds before Davis got the fans back on their feet with a series of hard power shots late in round four. Garcia displayed a solid straight left hand that he employed to counter the speed of Davis jabs, and was the busier fighter according to CompuBox, throwing 345 punches to Davis 239.\n \nHowever, it was Davis effective and efficient attack, which built as the fight went on, that helped him take control of the fight. After landing only four power punches in the first three rounds, Davis connected on 69 in rounds four through eight.\n \nI wasnt throwing a lot of shots in the beginning because I was trying to beat him mentally, said Davis. I was trying to trick him with my hands and my eyes and things like that because hes a tough fighter. I had to bait him.\n \nThe victory was Davis fifth successful defense of his WBA Lightweight Title, and one that the judges saw him in control of throughout, as he led 79-73 on two cards and 78-74 on the third. After the fight, Davis sent a message to his fellow unbeaten rival Ryan Garcia, as the two near a previously announced blockbuster clash this spring.\n \nGod willing Im ready for the fight with Ryan Garcia, said Davis. Its scheduled for April. Im here. Hes been training. Hes been talking. And lets see whos really about that.\n \nIn the co-main event, rising welterweight star Jaron Boots Ennis (30-0, 27 KOs) cruised to a unanimous decision over Karen Chukhadzhian (21-2, 11 KOs) to earn the vacant Interim IBF Welterweight Title after going 12 rounds for the first time by the score of 120-108 three times.\n \nI learned to just take my time and to not rush anything, said Ennis. Im glad I went 12 rounds. It felt great. I felt I was in the best shape. I just needed to throw a little more punches. I should have got him out of there.\n \n#DavisGarcia #GervontaDavis #HectorGarcia \n\nVisit PremierBoxingChampions.com for more info.\r\n\r\nSIGN UP FOR FIGHT ALERTS: \r\n\r\nhttps://pbcham.ps/FightAlerts\r\n\r\nFOLLOW US:\r\n\r\nhttps://twitter.com/premierboxing\r\nhttps://instagram.com/premierboxing\r\nhttps://www.facebook.com/premierboxingchampions"
